import './App.css';
import Form from './components/Form';
import { useQuery } from '@tanstack/react-query';

function App() {
  const {} = useQuery(['todos'],async()=>{
    await fetch('https://ocalhost:8000/todo')
  })
  return (
    <div className="App">
      <Form/>
    </div>
  );
}

export default App;
